import React, { useState } from 'react';
import { useQuery, useMutation } from 'react-query';
import { useForm } from 'react-hook-form';
import { 
  FileText, 
  Download, 
  Upload, 
  Code, 
  Eye, 
  Copy,
  CheckCircle,
  AlertCircle,
  XCircle
} from 'lucide-react';
import toast from 'react-hot-toast';
import { Prism as SyntaxHighlighter } from 'react-syntax-highlighter';
import { tomorrow } from 'react-syntax-highlighter/dist/esm/styles/prism';
import apiService from '../services/api';
import { FHIR_RESOURCE_TYPES, TOAST_MESSAGES } from '../constants';

const FhirPage = () => {
  const [activeTab, setActiveTab] = useState('metadata');
  const [selectedFormat, setSelectedFormat] = useState('json');
  const [fhirResponse, setFhirResponse] = useState('');
  const [responseType, setResponseType] = useState('');

  const { register, handleSubmit, formState: { errors } } = useForm();

  const { data: metadata, isLoading: metadataLoading } = useQuery(
    ['fhir-metadata', selectedFormat],
    () => apiService.getFhirMetadata(selectedFormat),
    {
      enabled: activeTab === 'metadata',
    }
  );

  const { data: codeSystem, isLoading: codeSystemLoading } = useQuery(
    ['fhir-codesystem', selectedFormat],
    () => apiService.getNamasteCodeSystem(selectedFormat),
    {
      enabled: activeTab === 'codesystem',
    }
  );

  const { data: conceptMap, isLoading: conceptMapLoading } = useQuery(
    ['fhir-conceptmap', selectedFormat],
    () => apiService.getNamasteToIcd11ConceptMap(selectedFormat),
    {
      enabled: activeTab === 'conceptmap',
    }
  );

  const translateMutation = useMutation(
    ({ code, system, targetSystem }) => apiService.translateConcept(code, system, targetSystem, selectedFormat),
    {
      onSuccess: (data) => {
        setFhirResponse(data);
        setResponseType('success');
        toast.success('Translation completed successfully');
      },
      onError: (error) => {
        setFhirResponse(error.message);
        setResponseType('error');
        toast.error('Translation failed');
      },
    }
  );

  const uploadBundleMutation = useMutation(
    (bundle) => apiService.uploadBundle(bundle, selectedFormat),
    {
      onSuccess: (data) => {
        setFhirResponse(data);
        setResponseType('success');
        toast.success('Bundle processed successfully');
      },
      onError: (error) => {
        setFhirResponse(error.message);
        setResponseType('error');
        toast.error('Bundle processing failed');
      },
    }
  );

  const createConditionMutation = useMutation(
    (data) => apiService.createCondition(data, selectedFormat),
    {
      onSuccess: (data) => {
        setFhirResponse(data);
        setResponseType('success');
        toast.success('Condition created successfully');
      },
      onError: (error) => {
        setFhirResponse(error.message);
        setResponseType('error');
        toast.error('Condition creation failed');
      },
    }
  );

  const onTranslateSubmit = (data) => {
    translateMutation.mutate(data);
  };

  const onBundleSubmit = (data) => {
    try {
      const bundle = JSON.parse(data.bundleJson);
      uploadBundleMutation.mutate(bundle);
    } catch (error) {
      toast.error('Invalid JSON format');
    }
  };

  const onConditionSubmit = (data) => {
    createConditionMutation.mutate(data);
  };

  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text);
    toast.success('Copied to clipboard');
  };

  const downloadResponse = (data, filename) => {
    const blob = new Blob([data], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = filename;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  const getCurrentData = () => {
    switch (activeTab) {
      case 'metadata':
        return { data: metadata, loading: metadataLoading };
      case 'codesystem':
        return { data: codeSystem, loading: codeSystemLoading };
      case 'conceptmap':
        return { data: conceptMap, loading: conceptMapLoading };
      default:
        return { data: null, loading: false };
    }
  };

  const { data: currentData, loading: currentLoading } = getCurrentData();

  const tabs = [
    { id: 'metadata', name: 'Metadata', icon: FileText },
    { id: 'codesystem', name: 'CodeSystem', icon: Code },
    { id: 'conceptmap', name: 'ConceptMap', icon: FileText },
    { id: 'translate', name: 'Translate', icon: Download },
    { id: 'bundle', name: 'Bundle Upload', icon: Upload },
    { id: 'condition', name: 'Create Condition', icon: CheckCircle },
  ];

  const TabButton = ({ tab, isActive, onClick }) => {
    const Icon = tab.icon;
    return (
      <button
        onClick={() => onClick(tab.id)}
        className={`flex items-center px-3 py-2 text-sm font-medium rounded-md ${
          isActive
            ? 'bg-primary-100 text-primary-700'
            : 'text-gray-500 hover:text-gray-700 hover:bg-gray-50'
        }`}
      >
        <Icon className="mr-2 h-4 w-4" />
        {tab.name}
      </button>
    );
  };

  const ResponseViewer = ({ data, title }) => (
    <div className="bg-white shadow rounded-lg">
      <div className="px-4 py-5 sm:p-6">
        <div className="flex items-center justify-between mb-4">
          <h3 className="text-lg font-medium text-gray-900">{title}</h3>
          <div className="flex items-center space-x-2">
            <select
              value={selectedFormat}
              onChange={(e) => setSelectedFormat(e.target.value)}
              className="input text-sm"
            >
              <option value="json">JSON</option>
              <option value="xml">XML</option>
            </select>
            {data && (
              <>
                <button
                  onClick={() => copyToClipboard(data)}
                  className="btn-secondary text-sm"
                >
                  <Copy className="h-4 w-4 mr-1" />
                  Copy
                </button>
                <button
                  onClick={() => downloadResponse(data, `${title.toLowerCase()}.${selectedFormat}`)}
                  className="btn-secondary text-sm"
                >
                  <Download className="h-4 w-4 mr-1" />
                  Download
                </button>
              </>
            )}
          </div>
        </div>

        {currentLoading ? (
          <div className="flex items-center justify-center py-12">
            <div className="loading-spinner"></div>
            <span className="ml-3 text-gray-600">Loading...</span>
          </div>
        ) : data ? (
          <div className="bg-gray-900 rounded-lg p-4 overflow-auto">
            <SyntaxHighlighter
              language={selectedFormat === 'json' ? 'json' : 'xml'}
              style={tomorrow}
              customStyle={{ margin: 0, fontSize: '14px' }}
            >
              {data}
            </SyntaxHighlighter>
          </div>
        ) : (
          <div className="text-center py-12">
            <FileText className="mx-auto h-12 w-12 text-gray-400" />
            <h3 className="mt-2 text-sm font-medium text-gray-900">No data available</h3>
            <p className="mt-1 text-sm text-gray-500">
              Select a format and try again.
            </p>
          </div>
        )}
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      {/* Header */}
      <div>
        <h1 className="text-2xl font-bold text-gray-900">FHIR Operations</h1>
        <p className="mt-1 text-sm text-gray-500">
          FHIR R4 compliant terminology server operations
        </p>
      </div>

      {/* Tabs */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <div className="flex flex-wrap gap-2">
            {tabs.map((tab) => (
              <TabButton
                key={tab.id}
                tab={tab}
                isActive={activeTab === tab.id}
                onClick={setActiveTab}
              />
            ))}
          </div>
        </div>
      </div>

      {/* Content */}
      {activeTab === 'metadata' && (
        <ResponseViewer data={metadata} title="Capability Statement" />
      )}

      {activeTab === 'codesystem' && (
        <ResponseViewer data={codeSystem} title="NAMASTE CodeSystem" />
      )}

      {activeTab === 'conceptmap' && (
        <ResponseViewer data={conceptMap} title="NAMASTE to ICD-11 ConceptMap" />
      )}

      {activeTab === 'translate' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Translate Code</h3>
              <form onSubmit={handleSubmit(onTranslateSubmit)} className="space-y-4">
                <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Source Code
                    </label>
                    <input
                      {...register('code', { required: 'Source code is required' })}
                      className="input"
                      placeholder="e.g., NAM001"
                    />
                    {errors.code && (
                      <p className="mt-1 text-sm text-red-600">{errors.code.message}</p>
                    )}
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Source System
                    </label>
                    <input
                      {...register('system', { required: 'Source system is required' })}
                      className="input"
                      placeholder="e.g., http://terminology.ayush.gov.in/CodeSystem/namaste"
                    />
                    {errors.system && (
                      <p className="mt-1 text-sm text-red-600">{errors.system.message}</p>
                    )}
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Target System (Optional)
                    </label>
                    <input
                      {...register('targetSystem')}
                      className="input"
                      placeholder="e.g., http://id.who.int/icd/release/11/2019-04"
                    />
                  </div>
                </div>
                <div className="flex justify-end">
                  <button
                    type="submit"
                    disabled={translateMutation.isLoading}
                    className="btn-primary"
                  >
                    {translateMutation.isLoading ? 'Translating...' : 'Translate'}
                  </button>
                </div>
              </form>
            </div>
          </div>

          {fhirResponse && (
            <ResponseViewer 
              data={fhirResponse} 
              title={`Translation Result ${responseType === 'success' ? '(Success)' : '(Error)'}`}
            />
          )}
        </div>
      )}

      {activeTab === 'bundle' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Upload FHIR Bundle</h3>
              <form onSubmit={handleSubmit(onBundleSubmit)} className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Bundle JSON
                  </label>
                  <textarea
                    {...register('bundleJson', { required: 'Bundle JSON is required' })}
                    rows={10}
                    className="input font-mono text-sm"
                    placeholder='{"resourceType": "Bundle", "type": "collection", "entry": [...]}'
                  />
                  {errors.bundleJson && (
                    <p className="mt-1 text-sm text-red-600">{errors.bundleJson.message}</p>
                  )}
                </div>
                <div className="flex justify-end">
                  <button
                    type="submit"
                    disabled={uploadBundleMutation.isLoading}
                    className="btn-primary"
                  >
                    {uploadBundleMutation.isLoading ? 'Processing...' : 'Upload Bundle'}
                  </button>
                </div>
              </form>
            </div>
          </div>

          {fhirResponse && (
            <ResponseViewer 
              data={fhirResponse} 
              title={`Bundle Processing Result ${responseType === 'success' ? '(Success)' : '(Error)'}`}
            />
          )}
        </div>
      )}

      {activeTab === 'condition' && (
        <div className="space-y-6">
          <div className="bg-white shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Create FHIR Condition</h3>
              <form onSubmit={handleSubmit(onConditionSubmit)} className="space-y-4">
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      NAMASTE Code
                    </label>
                    <input
                      {...register('namasteCode', { required: 'NAMASTE code is required' })}
                      className="input"
                      placeholder="e.g., NAM001"
                    />
                    {errors.namasteCode && (
                      <p className="mt-1 text-sm text-red-600">{errors.namasteCode.message}</p>
                    )}
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700 mb-2">
                      Patient ID
                    </label>
                    <input
                      {...register('patientId', { required: 'Patient ID is required' })}
                      className="input"
                      placeholder="e.g., Patient/123"
                    />
                    {errors.patientId && (
                      <p className="mt-1 text-sm text-red-600">{errors.patientId.message}</p>
                    )}
                  </div>
                </div>
                <div className="flex justify-end">
                  <button
                    type="submit"
                    disabled={createConditionMutation.isLoading}
                    className="btn-primary"
                  >
                    {createConditionMutation.isLoading ? 'Creating...' : 'Create Condition'}
                  </button>
                </div>
              </form>
            </div>
          </div>

          {fhirResponse && (
            <ResponseViewer 
              data={fhirResponse} 
              title={`Condition Creation Result ${responseType === 'success' ? '(Success)' : '(Error)'}`}
            />
          )}
        </div>
      )}
    </div>
  );
};

export { FhirPage };
